import dataStructure from '../resources/diagram.png'

function SkillCard() {

    return <div className="SkillCard">
        <div className="icon">
            <img src={dataStructure} alt='Icon'></img>
            <h4>Data Structures and algorithms</h4>
        </div>
    </div>
}

export default SkillCard;
